import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { inbox, sent, compose } from './navTabs';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles({
  root: {
    flexGrow: 1,
  },
});

export default function CenteredTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);
  const tab = useSelector((state) => state.tab.value);
  const dispatch = useDispatch();

  const handleChange = (event, newValue) => {
    setValue(newValue);
    switch (newValue) {
      case 0:
        console.log('inbox');
        break;
      case 1:
        console.log('sent');
        break;
      case 2:
        console.log('compose');
        break;
      default:
        console.log('inbox');
    }
  };

  return (
    <Paper className={classes.root}>
      <div
        style={{display: 'grid', gridTemplateColumns: 'repeat(20, 1fr)'}}
      >
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          centered
          style={{gridColumn: '2 / span 19'}}
        >
          <Tab label="inbox" />
          <Tab label="sent" />
          <Tab label="compose" />
        </Tabs>
        <Button
          variant="outlined"
          color="primary"
          href="/"
          style={{marginRight: '14px', gridColumn: '21', justifySelf: 'end'}}
        >
          Logout
        </Button>
      </div>
    </Paper>
  );
}
